import React from "react";

function CarsSelect() {
    return (
        <div className="carSlct">
            <fieldset>
                <label for=''></label>
                <input type="radio" name='car' id='Volvo7456'/>
                <input type="radio" name='car' id='MBenz3021'/>
                <input type="radio" name='car' id='Scania8790'/>
            </fieldset>
        </div>
    );
}

export default CarsSelect;
